ERROR - 2024-02-29 20:40:07 --> Query error: Incorrect string value: '\xD0\xB4\xD0\xB0\xD1\x80...' for column 'located_at' at row 1 - Invalid query: INSERT INTO `center_director` (`center_academy_id`, `name`, `email`, `dob`, `address`, `state`, `country`, `zip`, `special_qualification`, `experience_bharathanatiyam` , `master_name`, `events_performance` , `located_at`, `award_title` , `other_relevant_info`, `ballets_choreographed` , `created_by`, `updated_by`, `created_at`) VALUES (9088, 'PhillipRer', 'anna.marto.martova@mail.ru', '1970-01-01', 'Udon Thani', 'Thailand', 'Thailand', '141211', '', '', 'PhillipRer', '', 'kraken даркнет', 'kraken даркнет', 'Carl Lewis calls proposed format change in long jump an April Fools’ joke \r\n<a href=https://kraken8.it>kraken </a> \r\nA proposed format change could shake-up the long jump at major track and field competitions, but will the idea take flight? That’s the big question for those involved in the sport right now, notably nine-time Olympic gold medalist Carl Lewis. \r\n \r\nThe new format, which has been put forward by World Athletics chief executive Jon Ridgeon, could see athletes jump from a take-off zone, rather than a take-off board, essentially doing away with foul jumps. \r\n \r\nIt would mean that jumps are measured from where an athlete takes off to where they land in the pit. \r\nhttps://kraken8.it \r\nkraken marketplace \r\n“If you take the long jump at the world championships in Budapest last summer, a third of all jumps were no-jumps,” Ridgeon said on an episode of the Anything But Footy podcast, which was released on Monday. \r\n \r\n“Athletes stepping over the front of the take-off board – that doesn’t work, that’s a waste of time … <the>proposed format] means every single jump counts, it adds to the jeopardy of the competition, the drama of the competition.” \r\nRidgeon added that World Athletics will test the concept this year with “very good athletes,” explaining that “if it doesn’t pass testing, we’ll never introduce it.”', 'Carl Lewis calls proposed format change in long jump an April Fools’ joke \r\n<a href=https://kraken8.it>kraken </a> \r\nA proposed format change could shake-up the long jump at major track and field competitions, but will the idea take flight? That’s the big question for those involved in the sport right now, notably nine-time Olympic gold medalist Carl Lewis. \r\n \r\nThe new format, which has been put forward by World Athletics chief executive Jon Ridgeon, could see athletes jump from a take-off zone, rather than a take-off board, essentially doing away with foul jumps. \r\n \r\nIt would mean that jumps are measured from where an athlete takes off to where they land in the pit. \r\nhttps://kraken8.it \r\nkraken marketplace \r\n“If you take the long jump at the world championships in Budapest last summer, a third of all jumps were no-jumps,” Ridgeon said on an episode of the Anything But Footy podcast, which was released on Monday. \r\n \r\n“Athletes stepping over the front of the take-off board – that doesn’t work, that’s a waste of time … <the>proposed format] means every single jump counts, it adds to the jeopardy of the competition, the drama of the competition.” \r\nRidgeon added that World Athletics will test the concept this year with “very good athletes,” explaining that “if it doesn’t pass testing, we’ll never introduce it.”', 'User', 'User', '2024-02-29 20:40:07')
